import React, {useState}from 'react';
import Header from './Header';



function App() {

  const [counter, setCounter] = useState(0);

  function incremet(){
    setCounter( counter + 1)
  }

  return (

    <div>
    <Header >Counter: {counter}</Header>

    <button onClick={incremet}>Incrementear</button>
    </div>
  );
}

export default App;
